import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Homepage from './components.js/homepage/home';
import Menu from './components.js/menu/menu';
import PersonalForm from './components.js/forms/personal-form';
import MultiForm from './components.js/forms/multi-form';
import Payment from './components.js/forms/payment';
import ConfirmationPage from './components.js/forms/confirmation';
import Confirmation from './components.js/forms/confirm';
import Dashboard from './components.js/dashboard/dashboard';
import UserInfo from './components.js/dashboard/user-info';
import Payment1 from './components.js/dashboard/payment';


function App() {
  return (
      <div>
          <section>
          <Routes>
            <Route path='/' element={<Homepage/>}/>
            <Route path='/form' element={<MultiForm/>}/>
            <Route path='/payment' element={<Payment />} />
            <Route path='/dashboard' element={<Dashboard />} />
            <Route path='/info' element={<UserInfo />} />



          </Routes>
          </section>
      </div>
  );
}

export default App;
